    if (i < txt.length) {
      document.getElementById("helloWorld").innerHTML += txt.charAt(i);
      i++;
      setTimeout(typeWriter, 3000);
    }
  }

  return (
    <div>
      <h1>Dylan Mcgrann</h1>
      <span id="helloWorld">{setTimeout}</span>
    </div>
  )
}
